const data = $json.snippet;  // Ensure data is a string
const emailRegex = /(?:[-\s]*email[-\s]*)?([a-zA-Z0-9._%+-]+@[a-zA-Z0-9.-]+\.(?!png|jpg|gif|jpeg)[a-zA-Z]{2,})/gi;

// Check if data exists and is a string, then match emails
let emails = [];
if (typeof data === 'string') {
  emails = [...data.matchAll(emailRegex)]
    .map(match => match[1].toLowerCase());  // Extract clean email and convert to lowercase
}

// Return only if emails exist, otherwise return null to filter later
return emails.length > 0 ? { json: { emails } } : null;

return $json.items.map(item => ({
    json: {
        title: item.title,
        snippet: item.snippet,
        link: item.link,
        displayLink: item.displayLink
    }
}));
